// components/Listagem.js
import React, { useState, useEffect } from 'react';
import { obterSimulacoes } from '../services/api';
import ListagemItemDetalhes from './ListagemItemDetalhes'; 

import './ListagemItem.css';

const Listagem = () => {
  const [simulacoes, setSimulacoes] = useState([]);

  useEffect(() => {
    const fetchSimulacoes = async () => {
      try {
        const data = await obterSimulacoes();
        console.log('Dados retornados pela API:', data);
        setSimulacoes(data.simulacoes); 
      } catch (error) {
        console.error('Erro ao buscar simulações:', error);
      }
    };

    fetchSimulacoes();
  }, []);

  const simulacao = simulacoes.length > 0 ? simulacoes[0] : null;
  console.log(simulacao, "SIMULACAO");

  return (
    <div>
      {simulacao ? (
        <ListagemItemDetalhes simulacao={simulacao} />
      ) : (
        <p>Nenhuma simulação disponível.</p>
      )}
    </div>
  );
};

export default Listagem;
